ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = false;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}

labels.formatter:
function() {
var tempColor = '#000000';
var tempString = this.value.toString();
if (tempString.substr(0, 8) == '_(hide)_') {tempColor = '#7f7f7f'; tempString = tempString.replace('_(hide)_', '');}
return '<span style = "color: ' + tempColor + '; font-size: 12px;">' + tempString + '</span>';
}

